import axios from "axios"
import { useEffect, useState } from 'react';


function Mypage() {
    let [userData, setUserData] = useState(null);

    useEffect(() => {
        axios.get('http://localhost:8000/userData')  
        .then((res) => { 
            setUserData(res.data.id)
            console.log(res.data.id) // res.data에 id 들어가는 지 확인하기 , 계속 Not Logined 나오네..
        })
        .catch((err) => {
            console.log(err)
        })
    }, [])

    return (
        <div> 
            <h1> 이것은 {userData} 의 마이페이지  </h1>
        </div>
    )
}

export default Mypage
